  const [filteredProducts, setfilteredProducts] = useState([]);

  useEffect(() => {
    axios.get("https://jsonserverherokukn.herokuapp.com/products").then(res => {
      console.log(res);
    });
  });
  return (
    <Container>
      <div className="row">
        <div className="col-md-9">
          {/* <Products
            products={this.state.filteredProducts}
            handleAddToCart={this.handleAddToCart}
          /> */}
        </div>
      </div>
    </Container>
  );
};

export default Shop;
